return {  'tpope/vim-dadbod',  enabled = true,  lazy = false,  dependencies = {    'kristijanhusak/vim-dadbod-ui',    { 'kristijanhusak/vim-dadbod-completion', ft = { 'sql', 'mysql', 'plsql' }, lazy = true },  },  opts = {    db_competion = function()      ---@diagnostic disable-next-line      require('cmp').setup.buffer({ sources = { { name = 'vim-dadbod-completion' } } })    end,  },  cmd = {    'DBUI',    'DBUIToggle',    'DBUIAddConnection',    'DBUIFindBuffer',  },  config = function(_, opts)    vim.g.db_ui_use_nerd_fonts = 1    vim.g.db_ui_auto_execute_table_helpers = 1    -- vim.g.db_ui_execute_on_save = 0 --do not execute on save    vim.g.db_ui_icons = {      expanded = {        db = '▼',        buffers = '▼',        saved_queries = '▼',        schemas = '▼',        schema = '▼',        tables = '▼',        table = '▼',      },      collapsed = {        db = '▶',        buffers = '▶',        saved_queries = '▶',        schemas = '▶',        schema = '▶',        tables = '▶',        table = '▶',      },      saved_query = '*',      new_query = '+',      tables = '~',      buffers = '»',      add_connection = '[+]',      connection_ok = '✓',      connection_error = '✕',    }  end,  keys = {    { '<leader>Dt', '<cmd>DBUIToggle<cr>', desc = 'Toggle UI' },    { '<leader>Df', '<cmd>DBUIFindBuffer<cr>', desc = 'Find Buffer' },    { '<leader>Dr', '<cmd>DBUIRenameBuffer<cr>', desc = 'Rename Buffer' },    { '<leader>Dq', '<cmd>DBUILastQueryInfo<cr>', desc = 'Last Query Info' },  },}